import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { HiOutlineUserCircle } from 'react-icons/hi';
import { signOut } from 'firebase/auth';
import { auth } from '../firebase-config';
import CopyrightText from '../Components/CopyrightText.jsx';
import { Navbar, Typography } from '@material-tailwind/react';
import MenuIcon from '@material-ui/icons/Menu';

function HomePage() {
  const navigate = useNavigate();
  const [showMenu, setShowMenu] = useState(false);

  const handleLogout = () => {
    signOut(auth)
      .then(() => {
        console.log('Déconnexion réussie');
        alert('Déconnexion réussie');
        navigate('/');
      })
      .catch((error) => {
        alert(error.message);
      });
  };

  return (
    <div className="min-h-screen bg-gray-100">
      <Navbar className="bg-black">
        <div className="flex items-center justify-between w-full">
          <Typography
            as="a"
            href="#"
            variant="h6"
            className="cursor-pointer py-1.5 mr-auto text-white"
          >
            Goblo
          </Typography>
          <div className="hidden lg:flex items-center ml-auto">
            <Typography
              as="a"
              href="#"
              variant="body"
              className="text-white mx-4 cursor-pointer"
            >
              Mon Compte
            </Typography>
            <Typography
              as="a"
              href="#"
              variant="body"
              className="text-white cursor-pointer"
              onClick={handleLogout}
            >
              Déconnexion
            </Typography>
          </div>
          <MenuIcon
            className="block lg:hidden text-white cursor-pointer"
            onClick={() => setShowMenu(!showMenu)}
          />
        </div>
        {showMenu && (
          <div className="lg:hidden flex flex-col items-center mt-4">
            <Typography
              as="a"
              href="#"
              variant="body"
              className="text-white mx-4 cursor-pointer"
            >
              Mon Compte
            </Typography>
            <Typography
              as="a"
              href="#"
              variant="body"
              className="text-white cursor-pointer"
              onClick={handleLogout}
            >
              Déconnexion
            </Typography>
          </div>
        )}
      </Navbar>

      {/* Reste du contenu de la page */}
    </div>
  );
}

export default HomePage;
